import { useState } from "react"

export default function Main() {
    const [carros, setCarros] = useState({})

    async function listarVeiculos() {
        const listaCarros = await fetch('/veiculos')
        const carros = await listaCarros.json()
        setCarros(carros)
        console.log(carros)
    }


    listarVeiculos()
    return(
        <p>{carros}</p>
    )
}
